        this.state = { visivel: this.props.visivel }
    }

    toggleModal = () => {
        this.setState({ visivel: !this.state.visivel });
    }

    render(){
        return(
            <div style={{ display: this.state.visivel ? 'block': 'none' }} class={`modal ${this.props.className}`}>

            </div>
        )
    }
}

export default CustomModal;
